import React from "react"
import CharacterButton from "./CharacterButton";

function CharacterMenu( { characters , teamChars , setTeamChars} ) {

    const buttons = characters.map((char) => {
        return (
            <>
                <CharacterButton key={char.id} char={char} image={char.images.pixelImage} teamChars={teamChars} setTeamChars={setTeamChars}/>
                {char.id === 15 ? <br/>: null}
                {char.id === 29? <br/> : null}
            </>
                )
    })

    return(
        <div>
            {buttons}
        </div>
    )

}

export default CharacterMenu;
